import { Link } from "react-router-dom"
import { isAuthenticated } from "../services/Auth"
import './NavBar.css'
export default function NavBar(props){


    return ( 

        <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">User Authenticator</a>
          <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
                    <ul className="navbar-nav "  >

                        {!isAuthenticated()?(<li className="nav-item"><Link className="nav-link" to="/">Register</Link></li>):null}
                        {!isAuthenticated()?(<li className="nav-item"><Link className="nav-link" to="/login" >Login</Link></li>):null}
                        {isAuthenticated()?(<li className="nav-item"><Link className="nav-link" to="/dashboard" >Dashboard</Link></li>):null}
                        {isAuthenticated()?(<li className="nav-item"><Link className="nav-link"  onClick={props.logoutUser} style={{cursor:"pointer"}} >Logout</Link></li>):null}
                    </ul>
                </div>
            </div>
            </nav>
            )
}
